import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import ReadRestaurantes from './components/restaurantes/readRestaurante';
import UpdateRestaurante from './components/restaurantes/updateRestaurante';
import CreateRestaurante from './components/restaurantes/createRestaurante';



function Restaurantes(){

    return (
        <Router>
            <div>
                <h2 className='main-header2'> Restaurantes </h2>
                <Link to='/createRestaurante'>
                    <button>Crear Restaurantes</button>
                </Link>
                    <div>
                <Route path="/createRestaurantes" component={CreateRestaurante}></Route>
                </div>

                <div>
                    <Route path="/readRestaurantes" component={ReadRestaurantes}></Route>
                </div>

                <div>
                    <Route path="/updateRestaurantes" component={UpdateRestaurante}></Route>
                </div>

            </div>
        </Router>

    )
}


export default Restaurantes;
